INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('1', 'Diploma In ICT', 'ICT And Multimedia Technology', 'A Diploma in ICT (Information and Communications Technology) is a vocational qualification that\r\n                     provides students with the skills and knowledge they need to work in the field of ICT.', 'NVQ 5', '25000.00', 'GCE AL OR NVQ 3 OR 4', '10 Module', '18 Months', , , '8');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('2', 'Computer Graphic Design', 'ICT and Multimedia Technology', 'A Computer Graphics Design course typically covers the principles and techniques of digital design and illustration, including color theory, composition, and typography. Students may learn to use software such as Adobe Photoshop, Illustrator, and InDesign to create digital graphics, illustrations, and layouts. The course may also cover web design and animation. The course is suitable for students interested in pursuing a career in graphic design, web design, digital illustration, or related fields.', 'NVQ 4', '10000.00', 'GCE OL PASS', '5 Module', '6 Months', , , '7');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('3', 'Backery', 'Food Technology', 'A Bakery course is a program of study that focuses on the art and science of baking. It may cover a variety of topics including baking techniques, ingredients and their properties, recipe development, and food safety. Students will learn how to make a variety of baked goods including breads, pastries, cakes, and desserts. They will also learn how to decorate and present baked goods in an attractive manner. Some bakery courses may also cover business and management aspects of running a bakery, such as cost control, inventory management, and marketing. Bakery courses are suitable for individuals interested in working in a professional bakery, starting their own bakery business, or becoming a pastry chef.', 'NVQ 4', '1000.00', 'GCE OL PASS', '5 Module', '6 Months', , , '8');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('4', 'Beauty Culture', 'Beautician', 'A Beauty Culture course is a program of study that focuses on the art and science of personal grooming, beauty, and fashion. It may cover a variety of topics including hairstyling, makeup application, skincare, nail care, and esthetics. Students will learn about the latest trends and techniques in beauty culture, and how to use various tools and products to create different looks. They will also learn how to provide customer service and how to build and maintain a client base. Some beauty culture courses may also cover business and management aspects of running a salon or spa, such as scheduling appointments, managing inventory, and marketing. Beauty culture courses are suitable for individuals interested in working as a hairstylist, makeup artist, esthetician, or nail technician, or in starting their own beauty-related business.', 'NVQ 4', '10000.00', '8 TH PASS', '6 Module', '9 Months', , , '7');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('5', 'Auto Electrcian', 'Automobile Repair and Maintenance', 'An Auto Electrician course is a program of study that focuses on the electrical systems and components of vehicles. It may cover topics such as wiring diagrams, circuit testing, battery maintenance, and the diagnosis and repair of electrical problems. Students will learn how to use specialized tools and equipment to diagnose and repair electrical issues in vehicles. They will also learn about safety procedures and regulations related to working on vehicles. Some Auto Electrician courses may also cover advanced topics such as computerized engine management systems and hybrid/electric vehicles. Auto Electrician courses are suitable for individuals interested in becoming an auto electrician, working in the automotive industry, or starting their own auto electrician business.', 'NVQ 4', '10000.00', 'GCE 0L PASS', '6 Module', '12 Months', , , '8');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('6', 'Hair Dresser', 'Beautician', 'A Hairdresser course is a program of study that focuses on the art and science of cutting, styling, and coloring hair. It may cover a variety of topics including hair cutting techniques, hair coloring and highlighting, chemical treatments, and hair styling. Students will learn about the latest trends and techniques in hairdressing, and how to use various tools and products to create different looks. They will also learn about the anatomy and physiology of hair and scalp, as well as how to provide customer service and how to build and maintain a client base. ', 'NVQ 4', '10000.00', '8 TH PASS', '6 Module', '6 Months', , , '6');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('7', 'Machinist', 'Metal and Light Engineering', 'A machinist course is a type of vocational training program that teaches students the skills needed to operate and maintain various types of machinery used in manufacturing and industrial settings. The coursework typically includes instruction on the use of machine tools, such as lathes, milling machines, and grinders, as well as the principles of precision measurement and quality control. Some machinist courses may also cover topics such as blueprint reading, computer numerical control (CNC) programming, and welding. Upon completion of a machinist course, students may be qualified to work as machinists, machining operators, or other similar positions in manufacturing and industrial settings.', 'NVQ 4', '10000.00', 'GCE OL 6 SUBJECT PASS', '10 Module', '12 Months', , , '6');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('8', 'Ref and Ac Mechanic', 'Refrigeration and Air Conditioning', 'A Refrigeration and Air Conditioning (Ref and AC) Mechanic course is a vocational training program that teaches students the skills needed to install, maintain, and repair refrigeration and air conditioning systems. The coursework typically includes instruction on the principles of thermodynamics, refrigeration cycles, and the use of hand and power tools. Students learn how to troubleshoot and repair refrigeration and air conditioning systems, including electrical and mechanical components. Some Ref and AC Mechanic courses may also cover topics such as HVAC systems, welding, and safety practices. Upon completion of a Ref and AC Mechanic course, students may be qualified to work as Refrigeration and Air Conditioning mechanics, HVAC technicians, or other similar positions in the industry', 'NVQ 4', '10000.00', 'GCE OL 6 SUBJECT PASS', '10 Module', '12 Months', , , '6');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('9', 'ElectrIcian', 'Electrical and Electronic', 'An Electrician course is a vocational training program that teaches students the skills needed to install, maintain, and repair electrical systems. The coursework typically includes instruction on the principles of electricity, electrical circuits, and the use of hand and power tools. Students learn how to install, troubleshoot and repair various electrical systems, including wiring, lighting, and power distribution systems. Some Electrician courses may also cover topics such as electrical code compliance, safety practices, and renewable energy systems. Upon completion of an Electrician course, students may be qualified to work as electricians, electrical technicians, or other similar positions in the construction and maintenance industry. Additionally, some countries require passing an exam and getting a license to work as an electrician.', 'NVQ 4', '10000.00', 'GCE OL 6 SUBJECT PASS', '10 Module', '12 Months', , , '6');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('10', 'Computer Hardware Technician', 'ICT and Multimedia Technology', 'A Computer Hardware Technician course is a vocational training program that teaches students the skills needed to install, maintain, and repair computer hardware. The coursework typically includes instruction on the components of a computer, such as the processor, memory, storage, and peripheral devices, as well as the principles of computer architecture and troubleshooting. Students learn how to install, configure, and troubleshoot computer hardware, including motherboards, processors, memory, and storage devices. They also learn how to diagnose and repair problems with peripherals such as printers, scanners, and keyboards. Some Computer Hardware Technician courses may also cover topics such as computer networking, operating systems, and safety practices. Upon completion of a Computer Hardware Technician course, students may be qualified to work as computer hardware technicians, IT support technicians, or other similar positions in the computer and technology industry.', 'NVQ 4', '10000.00', 'GCE OL 6 SUBJECT PASS WITH CREDIT FOR ENGLISH', '5 Module', '6 Months', , , '6');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('11', 'ICT Technician', 'ICT and Multimedia Technology', 'An ICT Technician course is a program of study that focuses on the technical aspects of the Information and Communications Technology (ICT) industry. It may cover a variety of topics including computer hardware and software, networking, troubleshooting, and customer service. Students will learn how to install, configure, and maintain computer systems and networks, as well as how to diagnose and repair technical problems. They will also learn about best practices for maintaining computer security and data privacy. Some ICT Technician courses may also cover topics such as programming, web development, or mobile app development. ICT Technician courses are suitable for individuals interested in working as an ICT technician, network administrator, or IT support specialist, or in starting their own ICT-related business.', 'NVQ 4', '10000.00', 'GCE OL 6 SUBJECT PASS WITH CREDIT FOR ENGLISH AND MATHEMATICS', '10 Module', '6 Months', , , '6');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('12', 'Automobile Technician', 'Automobile Repair and Maintenance', 'An Automobile Technician course is a program of study that focuses on the mechanical and electrical systems of vehicles. It may cover a variety of topics including engine repair, transmission repair, brake systems, electrical systems, and computerized engine management systems. Students will learn how to diagnose and repair mechanical and electrical issues in vehicles, and how to use specialized tools and equipment to do so. They will also learn about safety procedures and regulations related to working on vehicles. Some Automobile Technician courses may also cover advanced topics such as hybrid and electric vehicles, and alternative fuel systems. Automobile Technician courses are suitable for individuals interested in becoming an automobile technician, working in the automotive industry, or starting their own auto repair business.', 'NVQ 4', '10000.00', 'GCE OL 6 SUBJECT PASS', '10 Module', '18 Months', , , '8');
INSERT INTO `course_details` (`id`, `course_name`, `course_category`, `course_desc`, `course_level`, `course_price`, `entry_qualifcation`, `module`, `time`, `course_img1`, `course_img2`, `rating`) VALUES
('13', 'Welder', 'Metal and Light Engineering', 'A Welder course is a program of study that focuses on the techniques and procedures for welding different materials using various welding processes. It may cover a variety of topics including safety, welding symbols and blueprint reading, welding metallurgy, and welding techniques such as Gas Tungsten Arc Welding (GTAW), Gas Metal Arc Welding (GMAW), and Shielded Metal Arc Welding (SMAW).\r\n\r\nStudents will learn how to properly set up and use welding equipment, how to select the appropriate welding process and filler metal for the job, and how to make quality welds that meet industry standards. They will also learn about welding inspection, quality control, and the repair of welding defects.', 'NVQ 4', '10000.00', 'GCE OL 3 SUBJECT PASS', '10 Module', '12 Months', , , '6');

